import React, { useState } from "react";
import './CurdOpration.css'

const CurdOperationHome = () => {
    const [state, setState] = useState({
        userName: "",
        age: "",

        userNameError: "",
        ageError: "",

        UserData: [],
        updatedUserData: [],
    });

    console.log("CURD", state);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setState(prevState => ({ ...prevState, [name]: value, userNameError: "", ageError: "" }));
    }

    const handleSubmit = () => {
        const { userName, age } = state;
        if (!userName) {
            setState(prevState => ({ ...prevState, userNameError: "Please Enter User Name" }));
            return;
        } else if (!age) {
            setState(prevState => ({ ...prevState, ageError: "Please Enter Age" }));
            return;
        }
        let newUser = {
            "userName": userName,
            "age": age
        }
        setState(prevState => ({ ...prevState, UserData: [...prevState.UserData, newUser], userName: "", age: "" }));
    }

    const handleDelete = (index) => {
        const deleteUserData = state.UserData.filter((_, i) => i !== index);
        setState(prevState => ({ ...prevState, UserData: deleteUserData }));
    }

    const handleEdit = (row) => {
        console.log("rowrow",row);
        setState(prevState => ({ ...prevState, updatedUserData }))
    }

    return (
        <div>
            <div className="card">
                <div className="card-body text-dark card_bg_Color">
                    <h4 className="text-center">Naresh</h4>
                </div>
            </div>

            <div class="row mt-2">
                <div class="col-lg-12">
                    <div class="card creation_Card">
                        <div class="card-body">
                            <div className="row col-lg-12">
                                <div>
                                    <h6>User Name : <span>{state.userNameError}</span></h6>
                                    <input type="text" name="userName" value={state.userName} className="form-control" onChange={handleChange} placeholder="Enter User Name" />
                                </div>
                                <div className="mt-2">
                                    <h6>Age : <span>{state.ageError}</span></h6>
                                    <input type="number" name="age" value={state.age} className="form-control" onChange={handleChange} placeholder="Enter Age" />
                                </div>
                                <div>
                                    <button className="btn btn-success mt-3" onClick={handleSubmit}>Submit</button>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

            <div className="mt-3">
                <table class="table table-bordered text-center">
                    <thead>
                        <tr>
                            <th scope="col">#</th>
                            <th scope="col">Name</th>
                            <th scope="col">Age</th>
                            <th scope="col">Edit</th>
                            <th scope="col">Delete</th>
                        </tr>
                    </thead>
                    <tbody>
                        {state.UserData.map((user, index) => (
                            <tr key={index}>
                                <td>{index + 1}</td>
                                <td>{user.userName}</td>
                                <td>{user.age}</td>
                                <td>
                                    <button className="btn btn-success" onClick={() => handleEdit(row)}>Edit</button>
                                </td>
                                <td>
                                    <button className="btn btn-danger" onClick={() => handleDelete(index)}>Delete</button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    )
}
export default CurdOperationHome;
